/*Table structure for table `inventory` */

DROP TABLE IF EXISTS `inventory`;

CREATE TABLE `inventory` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `sn` varchar(45) COLLATE latin1_general_ci NOT NULL,
  `client_code` varchar(20) COLLATE latin1_general_ci DEFAULT NULL,
  `project_code` varchar(20) COLLATE latin1_general_ci DEFAULT NULL,
  `product_id` int(11) DEFAULT NULL,
  `asset_no` varchar(45) COLLATE latin1_general_ci DEFAULT NULL,
  `batchid` varchar(45) COLLATE latin1_general_ci DEFAULT NULL,
  `principal_id` varchar(45) COLLATE latin1_general_ci DEFAULT NULL,
  `startdate` date DEFAULT NULL,
  `enddate` date DEFAULT NULL,
  `SLA` varchar(50) COLLATE latin1_general_ci DEFAULT NULL,
  PRIMARY KEY (`sn`),
  UNIQUE KEY `id` (`id`),
  KEY `fk_inventory_project1` (`project_code`),
  KEY `fk_inventory_product1` (`product_id`),
  CONSTRAINT `fk_inventory_product1` FOREIGN KEY (`product_id`) REFERENCES `product` (`product_id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=latin1 COLLATE=latin1_general_ci;

