/* Function  structure for function  `datedifference` */

/*!50003 DROP FUNCTION IF EXISTS `datedifference` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `datedifference`(date1 DATE, date2 DATE) RETURNS date
    NO SQL
BEGIN
    DECLARE dif DATE;
    IF DATEDIFF(date1, DATE(CONCAT(YEAR(date1),'-', MONTH(date1), '-', DAY(date2)))) < 0    THEN
                SET dif=DATE_FORMAT(
                                        CONCAT(
                                            PERIOD_DIFF(date_format(date1, '%y%m'),date_format(date2, '%y%m'))DIV 12 , 
                                            '-',
                                            PERIOD_DIFF(date_format(date1, '%y%m'),date_format(date2, '%y%m'))% 12 , 
                                            '-',
                                            DATEDIFF(date1, DATE(CONCAT(YEAR(date1),'-', MONTH(DATE_SUB(date1, INTERVAL 1 MONTH)), '-', DAY(date2))))),
                                        '%Y-%m-%d');
    ELSEIF DATEDIFF(date1, DATE(CONCAT(YEAR(date1),'-', MONTH(date1), '-', DAY(date2)))) < DAY(LAST_DAY(DATE_SUB(date1, INTERVAL 1 MONTH))) THEN
                SET dif=DATE_FORMAT(
                                        CONCAT(
                                            PERIOD_DIFF(date_format(date1, '%y%m'),date_format(date2, '%y%m'))DIV 12 , 
                                            '-',
                                            PERIOD_DIFF(date_format(date1, '%y%m'),date_format(date2, '%y%m'))% 12 , 
                                            '-',
                                            DATEDIFF(date1, DATE(CONCAT(YEAR(date1),'-', MONTH(date1), '-', DAY(date2))))),
                                        '%Y-%m-%d');
    ELSE
                SET dif=DATE_FORMAT(
                                        CONCAT(
                                            PERIOD_DIFF(date_format(date1, '%y%m'),date_format(date2, '%y%m'))DIV 12 , 
                                            '-',
                                            PERIOD_DIFF(date_format(date1, '%y%m'),date_format(date2, '%y%m'))% 12 , 
                                            '-',
                                            DATEDIFF(date1, DATE(CONCAT(YEAR(date1),'-', MONTH(date1), '-', DAY(date2))))),
                                        '%Y-%m-%d');
    END IF;
RETURN dif;
END */$$
DELIMITER ;

/* Function  structure for function  `getCaseID` */

/*!50003 DROP FUNCTION IF EXISTS `getCaseID` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `getCaseID`(project_code varchar(11)) RETURNS varchar(15) CHARSET latin1 COLLATE latin1_general_ci
    DETERMINISTIC
BEGIN
	DECLARE case_id VARCHAR(15);
	declare seq_month int (11);
	declare	cur_month int (11);
	
	SELECT MONTH(NOW()) into cur_month;
	SELECT MONTH into seq_month FROM seq WHERE TYPE='project' AND CODE=project_code;
	
	if seq_month <> cur_month then
		update 	seq 
		set 	month 	= cur_month,
			cur	= 0,
			nextval = 1
		where	TYPE	= 'project' 
		AND 	CODE	= project_code;
	end if;
	
	SELECT 	CONCAT(project_code,RIGHT(CONCAT('00',nextval),3),RIGHT(CONCAT('00',MONTH),2),RIGHT(CONCAT('00',YEAR(NOW())),2)) 
	INTO 	case_id 
	FROM 	seq 
	WHERE 	CODE = project_code 
	AND 	TYPE = 'project';
	
	RETURN case_id;
    END */$$
DELIMITER ;

/* Function  structure for function  `getDateDiff` */

/*!50003 DROP FUNCTION IF EXISTS `getDateDiff` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `getDateDiff`(durTime INT(11)) RETURNS varchar(255) CHARSET latin1 COLLATE latin1_general_ci
    DETERMINISTIC
BEGIN
	DECLARE t INT(11);
	DECLARE days INT(11);
	DECLARE hours INT(11);
	DECLARE minutes INT(11);
	DECLARE seconds INT(11);
	DECLARE s_days VARCHAR(255);
	DECLARE s_hours VARCHAR(255);
	DECLARE s_minutes VARCHAR(255);
	DECLARE s_seconds VARCHAR(255);
	DECLARE s_result VARCHAR(255);
	
	SET t 	   	= durTime;
	SET days 	= FLOOR(durTime/86400);
	SET t 		= t-(days*86400);	
	SET hours 	= FLOOR(t/3600);
	SET t 		= t-(hours*3600);
	SET minutes 	= FLOOR(t/60);
	SET seconds 	= t-(minutes*60);
	
	
	IF days < 1 THEN 
		SET s_days = '';
	ELSE 
		SET s_days = CONCAT(days, ' days');
	END IF;
	
	IF hours < 1 THEN 
		SET s_hours = '';
	ELSEIF hours = 1 THEN
		SET s_hours = 'An hour';
	ELSE 
		SET s_hours = CONCAT(hours, ' hours');
	END IF;	
	
	IF minutes < 1 THEN 
		SET s_minutes = '';
	ELSEIF minutes = 1 THEN 
		SET s_minutes = '1 minute';
	ELSE 
		SET s_minutes = CONCAT(minutes, ' minutes');
	END IF;	
	
	IF seconds < 1 THEN 
		SET s_seconds = '';
	ELSE 
		SET s_seconds = CONCAT(seconds, ' seconds');
	END IF;	
		
	SET s_result = CONCAT(s_days,' and ',s_hours,' and ',s_minutes,' and ',s_seconds);
	
	IF days = 0 AND hours = 0 AND minutes = 0 AND (seconds > -1 AND seconds < 59) THEN 
		SET s_result = 'Few seconds ago';
	ELSEIF days > 0 AND hours > 0 THEN 
		SET s_result = CONCAT(s_days,' and ',s_hours);
	ELSEIF days > 0 AND hours = 0 THEN 
		SET s_result = CONCAT(s_days,' and ',s_minutes);
	ELSEIF days = 0 AND hours = 0 THEN 
		SET s_result = CONCAT(s_minutes, ' ago');
	ELSEIF days = 0 AND hours > 0 AND minutes > 0 THEN 
		SET s_result = CONCAT(s_hours,' and ',s_minutes);	
	ELSEIF days = 0 AND hours = 0 AND minutes = 1  THEN 
		SET s_result = 'A minute ago';
	ELSEIF days = 0 AND hours = 0 AND minutes = 2  THEN 
		SET s_result = 'Two minutes ago';
	ELSEIF days = 0 AND hours = 0 AND minutes = 3  THEN 
		SET s_result = 'Three minutes ago';
	ELSEIF days = 0 AND hours = 0 AND minutes = 4  THEN 
		SET s_result = 'Four minutes ago';
	ELSEIF days = 0 AND hours = 0 AND minutes = 5  THEN 
		SET s_result = 'Five minutes ago';
	ELSEIF days = 0 AND hours = 0 AND minutes = 15  THEN 
		SET s_result = 'Fifteen minutes ago';
	ELSEIF days = 0 AND hours = 0 AND minutes = 30  THEN 
		SET s_result = 'Thirty minutes ago';
	END IF;	
	
	RETURN TRIM(s_result);
      END */$$
DELIMITER ;

/* Function  structure for function  `getDur` */

/*!50003 DROP FUNCTION IF EXISTS `getDur` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `getDur`(date1 DATETIME, date2 DATETIME) RETURNS varchar(100) CHARSET latin1 COLLATE latin1_general_ci
    DETERMINISTIC
BEGIN
	DECLARE maxAddrid VARCHAR(100);
	SELECT  
	(UNIX_TIMESTAMP(date1) - UNIX_TIMESTAMP(date2) - 86400 * (
	      (FLOOR(DATEDIFF(date1, date2) / 7) * 2) +
               IF(WEEKDAY(date1) > 4, WEEKDAY(date1) - 4, 0) + 
               IF(WEEKDAY(date1) < WEEKDAY(date2), 2, 0))) 
              INTO maxAddrid;
	RETURN maxAddrid;
      END */$$
DELIMITER ;

