DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `getProjCode`(code_client varchar(11)) RETURNS varchar(11) CHARSET latin1 COLLATE latin1_general_ci
    DETERMINISTIC
BEGIN
	DECLARE c_code VARCHAR(10);
	DECLARE project_code VARCHAR(10);
	
	SELECT client_code INTO c_code FROM CLIENT WHERE client_code=code_client;
	SELECT 	CONCAT(c_code,RIGHT(CONCAT('00',nextval),2)) 
	INTO 	project_code 
	FROM 	seq 
	WHERE 	CODE = c_code 
	AND 	TYPE = 'client';	
	
	RETURN project_code;
    END */$$
DELIMITER ;

/* Function  structure for function  `getTime` */

